import React from "react";
import Card from "./Card";
export default function Home(){
    const cardText = [
        "With a robust proficiency in Data Structures and Algorithms, my passion lies in the dynamic realm of Software Development, where I am fervently engaged in designing and implementing efficient solutions. My expertise extends to the intricate world of formal verification, where I meticulously ensure the correctness and reliability of software systems through rigorous mathematical modeling and verification techniques.",
"Delving into the intricate landscape of Distributed Systems, I navigate the complexities of designing and managing systems that span multiple interconnected nodes. My fascination with the theoretical facets of computer science propels me to explore and unravel the foundational principles that underpin the ever-evolving landscape of technology.",
"As an enthusiast for continuous learning, I actively engage with the latest advancements in the field, staying abreast of emerging trends and methodologies. My multifaceted skill set, combining a strong foundation in Data Structures, Algorithms, formal verification, and distributed systems, positions me as a versatile and adept professional capable of tackling diverse challenges in the expansive domain of computer science."  
    ]
    const renderItems = () => {
        const itemComponents = [];
        for (let i = 0; i < cardText.length; i++) {
          itemComponents.push(
            <Card text={cardText[i]}/>
          );
        }
        return itemComponents;
      };
    return (
        <div className="container">
            {renderItems()}
        </div>
    )
}
